(()=>{"use strict";(e=>{const t=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),o=document.getElementById("timer-seconds"),m=e=>e<10?"0"+e:e,s=()=>{let e=(()=>{let e=(new Date).getTime(),t=(new Date("14 september 2023").getTime()-e)/1e3;return{timeRemaining:t,hours:Math.floor(t/60/60),minutes:Math.floor(t/60%60),seconds:Math.floor(t%60)}})();t.textContent=m(e.hours),n.textContent=m(e.minutes),o.textContent=m(e.seconds),e.timeRemaining<0&&(t.textContent="00",n.textContent="00",o.textContent="00",clearImmediate(s))};setInterval(s,1e3)})(),console.log("two")})();